contract RocketToken is Ownable, Mintable, IERC20 {

    string private _name = "ROCKET";
    string private _symbol = "RKF";

    uint256 private _totalSupply;
    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;

    uint256 public buyDevFeeBPS = 300;
    uint256 public buyMarketingFeeBPS = 300;
    uint256 public buyBuybackFeeBPS = 100;
    uint256 public buyTotalFeeBPS = 700;

    uint256 public sellMarketingFeeBPS = 400;
    uint256 public sellBuybackFeeBPS = 500;
    uint256 public sellTotalFeeBPS = 900;

    address public devWallet;
    address public marketingWallet;
    address public buybackWallet;

    uint256 public swapTokensAtAmount = 10000000 * (10**18);
    uint256 public lastSwapTime;
    uint256 public swapNativeMinimum = 1000000000000000;

    bool private swapping;
